//import aos
import Aos from 'aos';
import 'aos/dist/aos.css';

//import components
import Hero from './components/Hero'
import Header from './components/Header'


const App = () => {

  //mobile navigation state
  const [NavMobile, set] = useState(false);
  //aos init
  useEffect(()=>{
    Aos.init({
      duration:2500,
      delay: 400,
    });
  });

  return(
    <div className='overflow-hidden'>
      <Header/>
      <Hero />
    </div> 
  );
   
};

export default App;
